import React from 'react'
import logo from '../mySource/logo.svg'
import main from '../mySource/logo.svg'
const Landing = () => {
  return (
    <main>
      <nav>
        <img src={logo} alt='123' className='logo' ></img>
      </nav>
    </main>
  )
}

export default Landing
